    <desc lang="en">Man's Noodles is passed down to the current generation. Man Shui (Raymond Cho), Man Nin (Hugo Wong) and Man Sai (Mark Ma) have learned the craft from their father and opened their own noodle shops. However, three shops on the same street have resulted in destructive competition. Lung Kau (Mayanne Mak), Fok Siu-yuk (Ashley Chu) and Kam Chi (Kamen Kong) are their wives respectively. They often quarrel as they earnestly defend their husbands. The siblings' mother Madam Man Ji Chin-hung (Nancy Sit) has not intervened in the feud between her three sons as she is faced with a dilemma. Just before CNY's Eve, Chin-hung sees her late husband in her dream. He brings up the topic of sibling rivalry and tells Chin-hung to restore things to order. Chin-hung then uses the legend of the Mans' Golden Bowl, which was bestowed by the Emperor, as an excuse for luring her three sons into temporarily staying at their old home from first to seventh of January. Chin-hung pretends to observe her sons and their family members' behavior which she uses as a basis for deciding who is the Golden Bowl winner. In fact, she hopes to unite everybody through participation by the three families in traditional CNY activities.</desc>
